import './App.css';
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom'; // Import necessary components from react-router-dom
import Main from "./component/navbar/Navbar";
import Signup from "./component/signup";
import Login from "./component/login";
import { Contact, Research, Problems, Process, Whatperiod, Header } from './container';
import { Cta, Navbar } from './component';

function App() {
  const user = false; // Define the user variable based on your logic
  return (
    <div className="App">
      <div className="gradient__bg">
        <Navbar />
        <Header />
      </div>
      <Routes>
        {/* Use Routes and Route components to define your routes */}
        {user ? (
          <Route path="/" element={<Main />} />
        ) : (
          <>
            <Route path="/signup" element={<Signup />} />
            <Route path="/login" element={<Login />} />
            <Route path="/" element={<Navigate replace to="/login" />} />
          </>
        )}
      </Routes>
      <Whatperiod />
      <Process />
      <Problems />
      <Cta />
      <Research />
      <Contact />
    </div>
  );
}

export default App;
